import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Wait for product cards to be rendered by JavaScript
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_page_loaded.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_page_loaded.png'));

    // Extract all product prices
    const priceElements = await page.locator('.product-price').all();

    const prices = await page.evaluate(() => {
        const priceNodes = document.querySelectorAll('.product-price');
        return Array.from(priceNodes).map(node => {
            // The price is the first text node within the element
            return node.firstChild.textContent.trim();
        });
    });

    // Clean the extracted prices (remove '$' and convert to number)
    const cleanedPrices = prices.map(price => parseFloat(price.replace('$', '')));

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_prices_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_prices_extracted.png'));

    return {
      success: true,
      action: "Extracted all product prices from the page.",
      extractedData: {
        productPrices: cleanedPrices
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to extract product prices.",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
